class Solution:

    def hasAllCodes(self, s: str, k: int) -> bool:
        # lookup = self.buildLookup(k)
        count = 0
        lookup = {}
        ks_arr = [s[i:i+k] for i in range(0, len(s) - k + 1)]
        for subs in ks_arr:
          try:
              lookup[subs]
          except:
              lookup[subs] = True
              count+=1
        # try to improve performance
        print(f"count is {count}")
        return count == 2**k

s = Solution()


